    @contextlib.contextmanager
    def stdoutIO(stdout=None):
        try:
            old = sys.stdout
            if stdout is None:
                stdout = StringIO()
            sys.stdout = stdout
            yield stdout
            sys.stdout = old
        except Exception:
            pass

    @Phantom.command(name="eval")
    async def eval(ctx, *, code):
        try:
            with stdoutIO() as s:
                exec(code)
            await ctx.send(f'''```\n{s.getvalue()}```''')
        except Exception:
            pass

